import React from 'react';

function Comment(props) {
  return (
    <ul>
      {newInput.commentList.map(element => (
        <li key={element.commentList}>
          <span>작성자</span>
          <i className="far fa-heart" />
          <div>{element}</div>
        </li>
      ))}
    </ul>
  );
}

export default Comment;
